import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <MyProvider>
    <App />
  </MyProvider>,
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
